import { useEffect, useState } from "react";

const useFetch = (url) => {
  const [user, setUsers] = useState(null);

  useEffect(() => {
    fetch(url)
      .then((res) => {
        res.json();
      })
      .then((data) => {
        setUsers(data);
      })
      .catch((err) => {
        console.log(err);
      });
  });

  return { user };
};

export default useFetch;
